        const res = await Send_Get_RestAPI('http://localhost:3001/staff')//them vo
        const json = await res.json();
        return {results : json , header: 'List Staff',name : 'Thanh' };
      }
    render() {
        return (
            <div>
               <Layout>
                   <StaffComponent/>
               </Layout>
            </div>
        )
    }
}

export default staff
